function MyMenu(){
    const menuItems = [
        {
            name : '我的啥'
        },{
            name : ''
        },{
            name : ''
        }
    ];
    return(
        <List animated selection>
            {menuItems.map((menuItem) => {
                return<List.Item key={menuItem.name}>{menuItem.name}</List.Item>
            })}
        </List>
    )
}
export default MyMenu;
